import './App.css';
import FooterComponent from './components/FooterComponent';
import HeaderComponent from './components/HeaderComponent';
import StudentListComponent from './components/StudentListComponent';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import CreateStudentComponent from './components/CreateStudentComponent';
import CreateGroupComponent from './components/CreateGroupComponent';
import GroupListComponent from './components/GroupListComponent';
import LogInComponent from './components/LogInComponent';

function App() {
  return (
    <div>
        <Router basename={'/journal'}>
          <HeaderComponent/>
          <div className="container">
            <Switch>
              <Route path = "/" exact component={StudentListComponent}></Route>
              <Route path = "/students" component={StudentListComponent}></Route>
              <AuthenticatedRoute path = "/groups" component={GroupListComponent}></AuthenticatedRoute>
              <AuthenticatedRoute path = "/add-student/:id" component={CreateStudentComponent}></AuthenticatedRoute>
              <AuthenticatedRoute path = "/add-group/:id" component={CreateGroupComponent}></AuthenticatedRoute>
              <AuthenticatedRoute path = "/login" component={LogInComponent}></AuthenticatedRoute>
              <AuthenticatedRoute path="/logout" exact component={LogoutComponent} />
            </Switch>
          </div>
          <FooterComponent/>
        </Router>
    </div>
  );
}

export default App;
